import React, { useState } from "react";

const SignUp = () => {

    const[credentials, setCredentials] = useState({name:"",email:"", password:""})

    const onChange = (e) => {
        setCredentials({...credentials,[e.target.name]:e.target.value})
    }

    const SignUp = async(e) =>{
        e.preventDefault();
        const response = await fetch("http://localhost:5000/api/auth/createuser", {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({ name:credentials.name, email:credentials.email, password:credentials.password }) // body data type must match "Content-Type" header
        });
        const res = await response.json(); // parses JSON response into native JavaScript objects
        console.log(res)
    }
    return (
        <div className="container my-3">
            <form>
                <div className="mb-3">
                    <label for="exampleInputName1" className="form-label">Name</label>
                    <input type="text" className="form-control" name="name" value={credentials.name} onChange={onChange} id="exampleInputPassword1" />
                </div>
                <div className="mb-3">
                    <label for="exampleInputEmail1" className="form-label">Email address</label>
                    <input type="email" className="form-control" id="exampleInputEmail1" name="email" value={credentials.email} onChange={onChange} aria-describedby="emailHelp" />
                </div>
                <div className="mb-3">
                    <label for="exampleInputPassword1" className="form-label">Password</label>
                    <input type="password" className="form-control" name="password" value={credentials.password} onChange={onChange} id="exampleInputPassword1" />
                </div>

                <button type="submit" className="btn btn-danger" onClick={SignUp}>SignUp</button>
            </form>
        </div>
    )
}

export default SignUp
